import React, { Component } from "react";

class Form extends Component {
  state = {
    username: "",
    password: "",
  };
  handlePassword
  render() {
    return (
      <div>
        <div>Form Component</div>
        <form>
          <label>
            {" "}
            Username:
            <input
              type="text"
              value={this.state.username}
              onChange={this.handleUsername}
            />
          </label>
          <br />
          <label>
            {" "}
            Password:
            <input
              type="password"
              value={this.state.password}
              onChange={this.handlePassword}
            />
          </label>
        </form>
      </div>
    );
  }
}

export default Form;
